import React from 'react';
import Col from 'Col.js';



export class Row extends React.Component{
    constructor(props){
        super(props);
    }

    render(){

        return(

            <div key={this.props.id}>
				<li className="list-group-item">
					<div className="media">
						<div className="media-body">
							<h4 className="mt-0">{this.props.firstName}</h4>
							<div className="container">
								<div className="row">
                                    <Col dataDisplay={this.props.street} gIcon = "glyphicon-map-marker"/>

                                    <Col dataDisplay={this.props.spaceType} gIcon = "glyphicon-home"/>
//									
								</div>
								<div className="row">
                                    <Col dataDisplay=".06$/sqInch" gIcon = "glyphicon-usd"/>

                                    <Col dataDisplay="8:00AM - 12:00PM (Monday-Friday)" gIcon = "glyphicon-time"/>

								</div>
								<div className="row">
                                    <Col dataDisplay="sq. ft remaining" gIcon = "glyphicon-resize-horizontal"/>

                                    <Col dataDisplay="OpenSpace Verified" gIcon = "glyphicon-ok-circle"/>
								</div>
							</div>
						</div>
//						<a href="/BookASpace"><button type="button" class="btn btn-primary">Book</button></a>
					</div>
				</li>
			</div>

        );
    }


}
export default Col;
